import { toJS } from "mobx";
import { flow, types } from "mobx-state-tree";
import axios from "axios";

const todo = types.model({
  id: types.number,
  todo: types.string,
  completed: types.boolean,
  userId: types.number,
});

const MobxStore = types
  .model({
    todoList: types.array(todo),
  })

  .actions((self) => ({
    loadTodos: flow(function* loadTodos() {
      let res = yield axios.get("https://dummyjson.com/todos");
      self.todoList = res.data.todos;

      console.log("mobx  ", res.data.todos);

      return res.data.todos;
    }),
  }))

  .views((self) => ({
    getTodo() {
      return toJS(self.todoList);
    },
  }));

const store = MobxStore.create({});

export default store;
